@小埋 请找出以下c++代码的错误：
class A
{
public:
    A() = default;
    ~A() = default;
};
class B : public A
{
public:
    B() = default;
    ~B() = default;
};

@小埋 请找出以下c++代码的不妥之处
class A
{
public:
    A() = default;
    ~A() = default;
};
class B : public A
{
public:
    B() : A() {}
    ~B() : ~A() {}
};
